def deduce_shared_number(n, m, ais, bis):

    def check(pair, pairs):
        res = []
        for p in pairs:
            s = pair & p
            if len(s) == 1:
                res.append(s.pop())
        res = list(set(res))
        if len(res) == 1:
            return res[0]
        elif len(res) > 1:
            return -1
        else:
            return 0
    ais = [set(ais[2 * i:2 * i + 2]) for i in range(n)]
    bis = [set(bis[2 * i:2 * i + 2]) for i in range(m)]
    va = [check(a, bis) for a in ais]
    vb = [check(b, ais) for b in bis]
    vap = [v for v in va if v > 0]
    vbp = [v for v in vb if v > 0]
    vap = set(vap)
    vbp = set(vbp)
    vabp = vap | vbp
    if -1 in va or -1 in vb:
        return -1
    elif len(vabp) > 1:
        return 0
    else:
        return vabp.pop() if vabp else -1

